// yearArr
const earliestYear = 1984;
const d = new Date();
const latestYear = d.getFullYear();

let yearArr = [];
for (let i = earliestYear; i <= latestYear + 1; i++) {
    yearArr.push(i);
}

let yearArrOpt = [];
for (let i = 0; i < yearArr.length; i++){
    yearArrOpt.push(yearArr[i]);
}
for (let i = 0; i < yearArrOpt.length; i++){
    yearArrOpt[i] = '<option value="' + yearArrOpt[i] + '">' + yearArrOpt[i] + '</option>';
}
yearArrOpt.push('<option selected disabled>select year</option>');
yearArrOpt.reverse();
yearArrOpt.push('<option>older than 1984</option>');
$('select#vehicle_year').html(yearArrOpt);

