$(document).ready(function () {
    let selectedYear = '';
    $('#vehicle_year').change(function () {
        selectedYear = $('#vehicle_year').val();
        let yearCheck = yearArr.includes(parseInt(selectedYear, 10));
        let makeOptionsArr = ['<option disabled selected>select make</option>'];
        if (yearCheck) {
            for (let i = 0; i < makesByYear.length; i++) {
                if (makesByYear[i].year == selectedYear) {
                    const selectedYearObj = makesByYear[i];
                    for (let x = 0; x < selectedYearObj.makes.length; x++) {
                        makeOptionsArr.push(selectedYearObj.makes[x]);
                    }
                }
            }

            for (let i = 0; i < makeOptionsArr.length; i++) {
                makeOptionsArr[i] = '<option value="' + makeOptionsArr[i] + '">' + makeOptionsArr[i] + '</option>';
            }

            $('select#vehicle_make').html(makeOptionsArr);

        } else {
            $('#year_text_input').html('<p>Enter 4 digit year</p><input type="text" id="vehicle_year year_input" name="vehicle_year" placeholder="ex. 1980"/>')
            let olderVehicleYear = $('#year_input').val();
            $('#vehicle_year').val(olderVehicleYear);
        }
    })

    $('#vehicle_make').change(function () {
        let selectedMake = $('#vehicle_make').val();
        let modelOptionsArr = ['<option disabled selected>select model</option>'];
        // for(let i = 0; i < yearMakeModel.length; i++){
        for (let i = 0; i < yearMakeModel.length; i++) {
            // console.log(yearMakeModel[i]);
            if (selectedYear == yearMakeModel[i].year && selectedMake == yearMakeModel[i].make) {
                modelOptionsArr.push(yearMakeModel[i].model);
            }
        }
        for (let x = 0; x < modelOptionsArr.length; x++) {
            modelOptionsArr[x] = '<option value="' + modelOptionsArr[x] + '">' + modelOptionsArr[x] + '</option>';
        }

        $('select#vehicle_model').html(modelOptionsArr);
    })

});

